import React from 'react';
import './DropdownMenu.css';

const DropdownMenu = props => {
    return (
        <div>
            <a href="#" data-activates="slide-out" className="side-nav right"><i className="material-icons">menu</i></a>

            <ul className="slide-out" id="mobile-demo">
                <h3 className="center" id="Menu">Menu</h3>
                <hr></hr>
                <li><a href="#" className="">Account Settings</a></li>
                <li><a href="#">Logout</a></li>
            </ul>

        </div>
    )
}

export default DropdownMenu
